import React from 'react';

function Certificate() {
  return (
    <section id="certificates" style={{ marginLeft: "10px", display: "flex", alignItems: "center", flexDirection: "column" }}>
      <h2 style={{ color: '#000000' }}>Certificates</h2>
      <div>
        <img src="https://via.placeholder.com/200x150" alt="Certificate 1" style={{ margin: '10px', width: '60%' }}/>
        <img src="https://via.placeholder.com/200x150" alt="Certificate 2" style={{ margin: '10px', width: '60%' }}/>
        <img src="https://via.placeholder.com/200x150" alt="Certificate 3" style={{ margin: '10px', width: '60%' }}/>
      </div>
    </section>
  );
}

export default Certificate;
